import { motion } from "framer-motion";

const languages = ["JavaScript", "TypeScript", "Python", "HTML/CSS", "SQL"];

const About = () => {
  return (
    <section id="about" className="relative py-32 bg-dark-bg overflow-hidden">
      {/* Background Decoration */}
      <div className="absolute inset-0 pointer-events-none">
        <div className="absolute top-0 right-0 w-96 h-96 bg-gradient-to-bl from-blue-500/10 to-transparent rounded-full blur-3xl" />
      </div>

      <div className="relative z-10 mx-auto max-w-7xl px-8">
        <motion.div
          className="mb-12"
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6 }}
        >
          <h3 className="text-blue-400 text-lg font-semibold mb-4">Introduction</h3>
          <h2 className="text-5xl md:text-6xl font-bold mb-8 text-white">About me</h2>
          <p className="text-lg leading-relaxed text-gray-300 max-w-4xl">
            I am a <span className="text-blue-400 font-semibold">dedicated IT undergraduate</span> with a strong foundation in SE and QA. With skills in MERN stack development and hands-on experience in software testing, I focus on building reliable, high-quality applications. I am passionate about learning new technologies, improving my craft, and contributing to impactful projects. As a quick learner and team player, I am always eager to take on new challenges and grow as a developer while ensuring software reliability, usability, and performance.
          </p>
        </motion.div>
            initial={{ opacity: 0, x: 30 }}
            whileInView={{ opacity: 1, x: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6, delay: 0.2 }}
          >
            <div className="card-premium">
              <h3 className="font-display text-2xl font-bold mb-5 text-gray-900 dark:text-white">Programming Languages</h3>
              <div className="flex flex-wrap gap-3">
                {languages.map((lang, index) => (
                  <motion.span
                    key={lang}
                    className="rounded-full bg-gradient-to-r from-primary-100 to-accent-100 dark:from-primary-900/40 dark:to-accent-900/40 border border-primary-200 dark:border-primary-800/50 px-5 py-2.5 text-sm font-semibold text-primary-700 dark:text-primary-300"
                    initial={{ opacity: 0, scale: 0.8 }}
                    whileInView={{ opacity: 1, scale: 1 }}
                    viewport={{ once: true }}
                    whileHover={{ scale: 1.05, y: -2 }}
                    transition={{ duration: 0.3, delay: index * 0.1 }}
                  >
                    {lang}
                  </motion.span>
                ))}
              </div>
            </div>

        <div className="grid gap-8 md:grid-cols-3 mt-16">
          {/* Languages Card */}
          <motion.div
            className="bg-dark-surface border border-gray-700 rounded-2xl p-8 hover:border-blue-500/50 transition-all duration-300"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6, delay: 0.1 }}
          >
            <div className="w-16 h-16 bg-gray-700/50 rounded-full flex items-center justify-center mb-6">
              <svg className="w-8 h-8 text-blue-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M10 20l4-16m4 4l4 4-4 4M6 16l-4-4 4-4" />
              </svg>
            </div>
            <h3 className="text-2xl font-bold mb-4 text-white">Languages</h3>
            <p className="text-gray-400">HTML, CSS, JavaScript, PHP, C, Java, React Js, Next Js</p>
          </motion.div>

          {/* Education Card */}
          <motion.div
            className="bg-dark-surface border border-gray-700 rounded-2xl p-8 hover:border-blue-500/50 transition-all duration-300"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6, delay: 0.2 }}
          >
            <div className="w-16 h-16 bg-gray-700/50 rounded-full flex items-center justify-center mb-6">
              <svg className="w-8 h-8 text-blue-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 14l9-5-9-5-9 5 9 5z" />
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 14l6.16-3.422a12.083 12.083 0 01.665 6.479A11.952 11.952 0 0012 20.055a11.952 11.952 0 00-6.824-2.998 12.078 12.078 0 01.665-6.479L12 14z" />
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 14l9-5-9-5-9 5 9 5zm0 0l6.16-3.422a12.083 12.083 0 01.665 6.479A11.952 11.952 0 0012 20.055a11.952 11.952 0 00-6.824-2.998 12.078 12.078 0 01.665-6.479L12 14zm-4 6v-7.5l4-2.222" />
              </svg>
            </div>
            <h3 className="text-2xl font-bold mb-4 text-white">Education</h3>
            <p className="text-gray-400">BSc (Hons) in Computing and Information Systems</p>
          </motion.div>

          {/* Projects Card */}
          <motion.div
            className="bg-dark-surface border border-gray-700 rounded-2xl p-8 hover:border-blue-500/50 transition-all duration-300"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.6, delay: 0.3 }}
          >
            <div className="w-16 h-16 bg-gray-700/50 rounded-full flex items-center justify-center mb-6">
              <svg className="w-8 h-8 text-blue-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 13.255A23.931 23.931 0 0112 15c-3.183 0-6.22-.62-9-1.745M16 6V4a2 2 0 00-2-2h-4a2 2 0 00-2 2v2m4 6h.01M5 20h14a2 2 0 002-2V8a2 2 0 00-2-2H5a2 2 0 00-2 2v10a2 2 0 002 2z" />
              </svg>
            </div>
            <h3 className="text-2xl font-bold mb-4 text-white">Projects</h3>
            <p className="text-gray-400">Built more than 5 projects</p>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
